import React from "react";
import { useState, useEffect } from "react";

export default function News() {
  const [post, setPost] = useState([]);

  useEffect(() => {
    fetch(
      "https://newsapi.org/v2/everything?q=health&from=2022-05-09&sortBy=publishedAt&apiKey=14ca7051b89b45fca6adf6fc35da4824"
    ).then((response) =>
      response.json().then((data) => setPost(data.articles))
    );
  }, []);

  post.forEach((article) => {
    console.log(article.content);
  });
  return (
    <div className="bbg-[#202124]   h-auto  mt-[100px] max-w-[1400px] mx-auto">
      <div className="flex gap-10">
        <div className="top-list w-[25%] sticky h-[400px]">
          <h1 className="text-3xl  text-gray-400 underline">NEWS</h1>
          <div className="h-full border-[1px] p-6 rounded-md mt-10">ss</div>
        </div>
        <div className="news-list max-w-[50%]">
          <div className="hhh bg-[#202124] h-[80px]">
            <h1 className=" text-3xl  text-white underline">NEWS</h1>
          </div>

          <div className="">
            {post.map((post) => (
              <div className="flex  mb-10">
                <div className="  border-[1px] p-6 rounded-md     flex flex-col gap-7 ">
                  <h1 className="text-2xl text-white">{post.title}</h1>
                  <img
                    className="mt-2 max-h-[300px]"
                    src={post.urlToImage}
                    alt=""
                  />
                  <p className="text-white">{post.content}</p>{" "}
                  <a
                    className="underline text-blue-700 text-righttext-blue-600"
                    href={post.url}
                  >
                    View more..
                  </a>
                  <p className="text-right text-gray-400">{post.publishedAt}</p>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="top-list w-[35%] sticky h-[700px]  ">
          <h1 className="text-3xl  text-gray-400 underline">NEWS</h1>
          <div>
            <div className="flex rounded-md border-[1px] flex-col mt-10 border-2 p-5">
              <h1 className="font-bold text-white">Health information</h1>
              <div className="flex justify-between ">
                <div
                  className="w-[70%] mt-2
                "
                >
                  <p className="text-gray-300 mt-4">
                    See the latest on coronavirus (COVID-19) prevention,
                    symptoms and treatment from the World Health Organization
                    (WHO) and others
                  </p>
                </div>
              </div>
            </div>
          </div>
          ss
        </div>
      </div>
    </div>
  );
}
